import React from "react"
import logo from './img/oina.png';

function Singin() {
    return (
        <div className="Singup">
            <img src={logo} alt="" />
            <form action="">
                <h4>Электронная почта</h4>
                <input type="text" name="login" id="login" placeholder="Введите электронную почту"/>
                <h4>Пароль</h4>
                <input type="text" name="password" id="password" placeholder="Введите пароль"/>
                <button type="submit" className="btn" >Войти</button>
                Впервые у нас? <a href="./Singup">Зарегистрируйтесь!</a>
            </form>
        </div>
        )
}

export default Singin;
